Nota: El parche sin usar debe colocarse en una bolsa, sellada para su almacenamiento; si usa calcetines o zapatos con el parche para el pie, puede hacer que el medicamento se pegue al calzado, por favor preste atenci√≥n; evite la luz solar directa y las altas temperaturas, intente colocarlo Gu√°rdelo en un lugar fresco y seco; los ni√±os necesitan la gu√≠a de un adulto al usarlo; si hay anomal√≠as como enrojecimiento y picaz√≥n durante el uso, deje de usarlo y consulte a un experto en piel; las mujeres embarazadas tienen prohibido usarlo. 

